import React from "react";
import { VerticalTimeline, VerticalTimelineElement } from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";
import { FaPencilAlt } from "react-icons/fa";
import './POR.css';

const WorkExperiencePage = () => {
  const experiences = [
    {
      title: "Co-President",
      subtitle: "The Showstoppers Dance Crew, MIT Manipal",
      duration: "Jul 2021 - May 2022",
      description: [
        "Actively worked with a team of 4 to design and implement object detection and avoidance algorithms, effectively communicating and solving problems to make the solar powered car autonomous.",
        "Conducted in-depth research on various object detection models, prepared a report, and selected the YOLO v3 model as the most suitable for the project based on performance and accuracy metrics.",
        "Leveraged YOLO v3 and Robot Operating System to create innovative solutions, quickly adapting to new tools and challenges to achieve the project's goals. "
    ],
      icon: <FaPencilAlt />,
      iconBg: "#f1c40f",
    },
    {
      title: "Solar Mobil Student Project",
      subtitle: "MIT, Manipal",
      duration: "Sep 2020 - Aug 2021",
      description: [
        "Actively worked with a team of 4 to design and implement object detection and avoidance algorithms, effectively communicating and solving problems to make the solar powered car autonomous.",
        "Conducted in-depth research on various object detection models, prepared a report, and selected the YOLO v3 model as the most suitable for the project based on performance and accuracy metrics.",
        "Leveraged YOLO v3 and Robot Operating System to create innovative solutions, quickly adapting to new tools and challenges to achieve the project's goals. "
    ],
      icon: <FaPencilAlt />,
      iconBg: "#9b59b6",
    },
    {
      title: "Organiser for Social Media and Graphics",
      subtitle: "Tech Tatva'20, MIT Manipal",
      duration: "Sep 2020 - Oct 2020",
      description: [
        "Enhanced the CloudUsage app performance by 70%, an application used to generate billing logs for Microsoft Azure accounts.",
        "Developed a proof of concept by analyzing 4+ performance optimization techniques, conducting performance testing, and benchmarking query execution times across varying storage accounts based on thread count to improve application efficiency.",
        "Integrated multithreading in Python, enabling concurrent processing of Azure accounts using only 5 threads.",
        "Reduced processing time from 510 seconds to just 160 seconds for 600 storage accounts, successfully deploying the optimized code."
    ],
      icon: <FaPencilAlt />,
      iconBg: "#247625",
    },
  ];

  return (
    <div className="por">
      <h1>POSITIONS OF RESPONSIBILITY</h1>
      <VerticalTimeline layout="1-column-left"> 
        {experiences.map((exp, index) => (
          <VerticalTimelineElement
            key={index}
            date={exp.duration}
            iconStyle={{ background: exp.iconBg, color: "#fff" }}
            icon={exp.icon}
            position="right"
          >
            <h3 className="vertical-timeline-element-title">{exp.title}</h3>
            <h4 className="vertical-timeline-element-subtitle">{exp.subtitle}</h4>
            <ul>
              {exp.description.map((point, idx) => (
                <li key={idx}>{point}</li>
              ))}
            </ul>
          </VerticalTimelineElement>
        ))}
        <VerticalTimelineElement
          iconStyle={{color: "#f7f6f6" }}
          contentStyle={{ display: "none" }}
          position="right"
        />
      </VerticalTimeline>
    </div>
  );
};

export default WorkExperiencePage;
